import substring_search


def test_brute_force_1():
    offsets = [0, 6, 11, 16, 21]
    result = substring_search.brute_force("ABCasdABCaaABCddABCddABC", "ABC")
    assert result == offsets


def test_brute_force_2():
    offsets = list(range(0, 27))
    results = substring_search.brute_force("aaaaaaaaaaaaaaaaaaaaaaaaaaa", "a")
    assert results == offsets


def test_brute_force_3():
    offsets = []
    result = substring_search.brute_force("ababababababababab", "bb")
    assert result == offsets


def test_brute_force_4():
    offsets = [3, 17, 29, 42, 47]
    result = substring_search.brute_force("abbaabbaabbbabaabaabbabbaabbbaabbabbbbbbaaaabbaaabbaaaaaabb", "aabba")
    assert result == offsets


def test_brute_force_5():
    text =  ""
    offsets = [3662, 4388, 5851, 7155, 7965, 11681, 15022, 20702, 22664, 23836, 24403, 24527, 26307, 34660]
    results = substring_search.brute_force(text, "acbcaca")
    assert results == offsets


